(37, 'BABS bus service', 'Buckie accessible community bus scheme. Covers Buckie, Cullen, Fochabers and Keith areas. Provides fully trained passenger assistants.', 3, 'Office Telephone: (01542) 835800 BABS Dial-a-Bus Ltd 11 March Road East Buckie AB56 4BY', '1', NULL, NULL, '2015-09-29 12:04:51', NULL),
(38, 'BABS car service', 'Car hire with driver service.  Buckie, Cullen, Fochabers and Keith areas to Elgin and local hospitals. ', 3, 'Call us to book your trip. \r\nPhone: (01542) 835800', '0', NULL, NULL, '2015-05-06 11:57:28', NULL),
(39, 'Banffshire Partnership Dial a Bus', 'Wheelchair accessible door to door service', 3, 'contact us: \r The Old School, Boyndie, Banff. AB45 2JT Tel: 01261 843598 FFFax: 01261 843598 E-mail: bpl.transport@banffdab.org.uk', '0', NULL, NULL, '2015-05-06 12:06:48', NULL),
(40, 'M for Moray - Buckie service', 'Buckie area accessible on-demand bus.  ', 3, 'Contact us to book your trip. \r Dial M for Moray  Tel: 01343 562533 Email: transport@moray.gov.uk', '0', NULL, NULL, '2015-05-06 12:14:16', NULL),
